import { Toaster } from "react-hot-toast";
import { useRoutes } from "react-router-dom";
import routes from "./routes";


function App() {
  return (
    <>
      {useRoutes(routes)}
      <Toaster position="top-right" />
    </>
  );
}

export default App;
